import React, { Component } from 'react'
import axios from 'axios'
import NestedGrid from "../components/NestedGrid"

import articulos from '../static/files/noticias.json'


export default class Articulos extends Component {

    state = {
        articulos: []
    }
    componentDidMount() {
        fetch('../static/files/noticias.json')
            .then((res) => res.json())
            .then((data) => {
                res => this.setState({ articulos: data })
            })

        
    }
    /*
      return this.state.articulos.map((articulo)=>(
            <React.Fragment>
                <Articulo key={articulo.id} articulo={articulo} ver={this.props.ver} estilo={this.useStyles}/>
            </React.Fragment>
        ))
    */
    render() {
        return (
            <React.Fragment>
                <NestedGrid articulos={this.state.articulos} />
            </React.Fragment>
        )

    }
}
